import styled from 'styled-components';

export const HeaderArea = styled.div `

    .btn{

        background-color:#9f6ff2;
        padding:20px;
        margin:10px;
        cursor: pointer;

        .btn--text{
            font-size:14px;
            color: #fff;
            padding:5px;
        }

        .btn--text:hover{
            border: 1px solid #000;
        }
    }


`
